import React from 'react'

export const AddTransaction = () => {
    return (
        <div>
            <form>
                <input type="text" placeholder="Source"/>
                <input type="number" placeholder="Amount"/>
                <button type="submit">Submit</button>
            </form>
        </div>
    )
}
